Count 1: Misdemeanor Battery, Domestic Abuse, contrary to Wisconsin Statutes section(s) 940.19(1), 939.51(3)(a), 968.075(1)(a), a Class A Misdemeanor;
Count 2: Disorderly Conduct, Domestic Abuse, contrary to Wisconsin Statutes section(s) 947.01(1), 939.51(3)(b), 968.075(1)(a), a Class B Misdemeanor;
Count 3: Fourth Degree Sexual Assaut, Domestic Abuse, contrary to Wisconsin Statutes section(s) 940.225(3m), 939.51(3)(a), 968.075(1)(a), a Class A Misdemeanor.
